import React from 'react';
import ReactDOM from 'react-dom';

class Logo extends React.Component {
    Logo(){
      this.hovered = true;
    }
    render() {
      if(this.hovered){
        this.hovered = false;
        return (
          <div className="shopping-list">
            <h1>MyPHARM</h1>
          </div>
        );
      }

    }
  }

  ReactDOM.render(<Logo/>, document.getElementById("navbar"));
